import { addDoc, collection, onSnapshot, orderBy, query, serverTimestamp, setDoc } from 'firebase/firestore';
import type { GetServerSidePropsContext, InferGetServerSidePropsType } from 'next';
import { ChangeEvent, Fragment, useCallback, useEffect, useRef, useState } from 'react';
import { RiAdminLine, RiFolderAddFill, RiFolderAddLine } from 'react-icons/ri';
import { Loading } from '../../components/Loading';
import { Breadcrumb } from '../../components/breadcrumb';
import { PageWrapper } from '../../components/page-wrapper';
import { langCode } from '../../language/lang';
import { CategoriesDocument, PostDocument } from '../../types/firestore';
import { Global } from '../../types/global';
import { db, storage } from '../../utils/firebase';
import { Dialog, Transition } from '@headlessui/react';
import { SetterOrUpdater } from 'recoil';
import Image from 'next/image';
import { getDownloadURL, ref, uploadString } from 'firebase/storage';
import { makeid } from '../../components/ebook-modal';
import { timestamp2Chinese } from '../posts/[pid]';

function Noti({ lang }: InferGetServerSidePropsType<typeof getServerSideProps>) {
  const dataFetchedRef = useRef<boolean>(false);
  const [modalAddCategories, setModalAddCategories] = useState(false);
  const [serverSnapshot, setServerSnapshot] = useState<{ id: string; data: CategoriesDocument }[]>();
  const [renderCategories, setRenderCategories] = useState<{ id: string; data: CategoriesDocument }[]>();
  useEffect(() => {
    if (dataFetchedRef.current) return;
    dataFetchedRef.current = true;
    onSnapshot(query(collection(db, 'categories'), orderBy("createdTimestamp", 'desc')), snapshot => {
      setServerSnapshot(snapshot.docs.map((doc) => {
        return { id: doc.id, data: doc.data() as CategoriesDocument };
      }));
      setRenderCategories(snapshot.docs.map((doc) => {
        return { id: doc.id, data: doc.data() as CategoriesDocument };
      }));
    })
  }, []);
  const onChangeCategories = (id: string) => {
    setRenderCategories(serverSnapshot?.flatMap((cat) => {
      if(cat.id === id){
        return (cat)
      }
      return([])
    }))
  }
  return (
    <>
      <PageWrapper lang={lang} page={Global.webMap.admin.child.notification} withNavbar={true} operating={false}>
        <Breadcrumb args={[{ title: "管理員", href: "/admin", icon: RiAdminLine }, { title: Global.webMap.admin.child.categories.title(lang), href: Global.webMap.admin.child.categories.href, icon: Global.webMap.admin.child.categories.nav.icon }]} />
        {!serverSnapshot && <Loading text='正在載入中' />}
        {serverSnapshot && <div className='mx-auto my-6 w-full bg-background2 rounded-md min-h-[70vh] px-8 py-6'>
          <ToolBar level={0} setModalAddCategories={setModalAddCategories} />
          <div className='flex flex-col space-y-6 divide-x-2'>
            {renderCategories!.map((cat, key) => (
              <div key={key} className='flex flex-row gap-4 justify-start items-center cursor-pointer hover:scale-105 transition-all duration-500' onClick={() => onChangeCategories(cat.id)}>
                <Image width={1200} height={420} src={cat.data.thumbnail} className="w-[24vw] h-auto object-cover mx-auto aspect-[120/42] rounded-md overflow-hidden" alt={`縮圖-${cat.data.title}`} />
                <div className='basis-3/4 flex flex-col text-main group-hover:text-main2 transition-all duration-300'>
                  <h3 className='text-2xl font-medium'>{cat.data.title}</h3>
                  <div className='text-xs mt-3 space-x-2'>
                    <span>{timestamp2Chinese((cat.data.createdTimestamp as any).seconds)} (台灣時間)</span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>}
      </PageWrapper>
      <AddCategoriesModal modalOpen={modalAddCategories} setModalOpen={setModalAddCategories} />
    </>
  );
}


export const ToolBar = ({ level, setModalAddCategories }: { level: number; setModalAddCategories: SetterOrUpdater<boolean> }) => {
  const onAddCategories = () => {
    setModalAddCategories(true);
  }
  return (
    <div className='flex flex-row justify-end text-main'>
      <div className='group flex flex-row space-x-2 hover:text-main2 cursor-pointer items-center' onClick={onAddCategories}>
        <div className='relative w-5 h-5'>
          <RiFolderAddFill className='absolute w-5 h-5 opacity-0 group-hover:opacity-100 transition-all duration-300' />
          <RiFolderAddLine className='absolute w-5 h-5 opacity-100 group-hover:opacity-0 transition-all duration-300' />
        </div>
        <span className='transition-all duration-300'>新增類別</span>
      </div>
    </div>
  )
}

const AddCategoriesModal = ({ modalOpen, setModalOpen }: { modalOpen: boolean; setModalOpen: SetterOrUpdater<boolean> }) => {
  const filePickerRef = useRef<HTMLInputElement>(null);
  const titleRef = useRef<HTMLInputElement>(null);
  const [loading, setLoading] = useState(false);
  const descriptionRef = useRef<HTMLTextAreaElement>(null);
  const [profileAvatar, setProfileAvatar] = useState(defaultImage);
  const [rowTextarea, setTextarea] = useState<number>(1);
  const handleTextArea = (e: ChangeEvent<HTMLTextAreaElement>) => {
    const hiddenTextarea = document.querySelector("#hidden-textarea") as HTMLTextAreaElement;
    if (hiddenTextarea) {
      hiddenTextarea.value = e.target.value;
      setTextarea(hiddenTextarea.scrollHeight / 24);
    }
  }
  const onRefChange = useCallback((node: HTMLTextAreaElement) => {
    if (node === null) return;
    const lookMount = setInterval(() => {
      if (node.scrollHeight !== 0) {
        clearInterval(lookMount);
        setTextarea(node.scrollHeight / 24);
      }
    }, 1)
  }, []);
  const fileReader = (e: ChangeEvent<HTMLInputElement>) => {
    const reader = new FileReader();
    if (e.target.files) {
      if (e.target.files[0]) {
        reader.readAsDataURL(e.target.files[0])
      }
      reader.onload = (renderEvent) => {
        if (renderEvent.target) {
          if (typeof (renderEvent.target.result) == "string") {
            setProfileAvatar(renderEvent.target.result)
          }
        }
      }
    }
  }
  const onAddCategories = async () => {
    const title = titleRef.current?.value;
    const description = descriptionRef.current?.value;
    setLoading(true);
    try {
      const imageRef = ref(storage, `categories/image/${makeid(18)}-${filePickerRef.current?.files?.[0]?.name || "noname.jpg"}`)
      await uploadString(imageRef, profileAvatar, "data_url")
      const downloadUrl = await getDownloadURL(imageRef);
      await addDoc(collection(db, "categories"), {
        createdTimestamp: serverTimestamp(),
        description: description,
        thumbnail: downloadUrl,
        title: title
      })
    } catch (e) {
      alert("錯誤，請至控制台查看原因")
      console.log(e);
    }
    setLoading(false);
  }
  return (
    <Transition show={modalOpen} as={Fragment}>
      <Dialog onClose={() => { setModalOpen(false); }} as="div" className="fixed z-30 inset-0 overflow-y-auto" >

        {/* BackBlur */}
        <Transition.Child as={Fragment}
          enter="transition duration-75 ease-out"
          leave="transition duration-75 ease-out"
          enterFrom="transform opacity-0"
          enterTo="transform opacity-100"
          leaveFrom="transform opacity-100"
          leaveTo="transform opacity-0">
          <div className="fixed inset-0 bg-black/30" aria-hidden="true" />
        </Transition.Child>

        {/* MenuContainer */}
        <Transition.Child as={Fragment}
          enter="transition duration-100 ease-out"
          leave="transition duration-75 ease-out"
          enterFrom="transform scale-75 opacity-50"
          enterTo="transform scale-100 opacity-100"
          leaveFrom="transform scale-100 opacity-100"
          leaveTo="transform scale-75 opacity-50"
        >
          <div className="fixed inset-0 flex items-center justify-center">
            <div className="flex flex-col px-8 py-6 bg-background/95 text-main rounded-lg items-center justify-center">
              <Dialog.Title>
                <h1 className='font-medium text-2xl mb-2'>新增類別</h1>
              </Dialog.Title>
              <Dialog.Panel as="div" className="flex flex-col text-main">
                {!loading && <div className="flex flex-col space-y-4">
                  <div className="relative rounded-lg overflow-hidden group cursor-pointer" onClick={() => filePickerRef.current!.click()}>
                    <Image width={1200} height={420} src={profileAvatar} className="w-[65vw] md:w-[45vw] h-auto object-cover mx-auto aspect-[120/42]" alt="請選擇類別圖示" />
                    <div className='absolute bottom-0 opacity-30 hover:opacity-100 w-full h-6 bg-gray-600 bg-opacity-75 text-white text-xs text-center py-1 transition-opacity'>按此更換</div>
                    <input type={"file"} hidden ref={filePickerRef} onChange={fileReader} accept='image/*'></input>
                  </div>
                  <div className="flex flex-col border-main border-b-2">
                    <p className="text-xs text-main/80">標題</p>
                    <input type='text' autoComplete='false' className="bg-transparent focus:outline-none text-2xl" ref={titleRef} />
                  </div>
                  <div className="flex flex-col border-main border-b-2">
                    <p className="text-xs text-main/80">預覽簡述：</p>
                    <textarea id="textarea" className="text-base resize-none w-[45vw] bg-transparent focus:outline-none" rows={rowTextarea} placeholder="請輸入簡述" onChange={handleTextArea} ref={descriptionRef} />
                    <textarea id="hidden-textarea" className="text-base resize-none w-[45vw] invisible absolute overflow-hidden" rows={1} ref={onRefChange} disabled></textarea>
                  </div>
                  <div className='flex flex-col-reverse md:flex-row w-full justify-around'>
                    <button className='px-3 py-2 bg-red-600 text-xs text-background2 rounded-lg md:rounded mt-2 md:mt-0' onClick={() => setModalOpen(false)}>關閉</button>
                    <button onClick={onAddCategories} className='px-3 py-2 bg-green-600 text-xs text-background2 rounded-lg md:rounded mt-2 md:mt-0 disabled:bg-green-600/70'>新增</button>
                  </div>
                </div>}
                {loading && <Loading text='新增中' height={28} />}
              </Dialog.Panel>
            </div>
          </div>
        </Transition.Child>
      </Dialog >
    </Transition >
  )
}

export async function getServerSideProps(context: GetServerSidePropsContext) {
  return {
    props: {
      lang: (context.locale ? context.locale : "zh") as langCode,
    },
  };
}

export default Noti

const defaultImage = "data:image/jpeg;base64,"